import React, { Component } from 'react';
import styled from 'styled-components'

const Subtitle = styled.div`
    font-size: 24px;
    font-weight: 500;
    color: rgb(105, 48, 44);
`
const LinkTo = styled(Link)`
  cursor: pointer;
  color: #69302c;
  margin: 0px;
  &:hover {
    color: #69302c;
  }
`
const LinkButton = styled(Link)`
  color: #69302c;
  margin: 0px;
  &:hover {
    color: #69302c;
    text-decoration: none;
  }
`

const Landing = styled.div`
  color:#69302c;
  font-weight: 500;
  margin-bottom: 5em;
`
const Head = styled.h1`
  margin-bottom: 3%;
  margin-top: 10%;
  font-size: 55px;
  font-weight: bold;
  line-height: 1.35;
  color: #69302c;
`

const SubText = styled.div`
  font-size: 21px;
`

const Sub = styled.p`
  font-size: 24px;
  font-weight: 500;
  color: #69302c;
`
class App extends Component {
    render() {
        return (
            <div class="container">
                <div class="row">
                    <div class="col">
          <Head>
            ถ้าพูดเยอะอาจจะเจ็บคอ<br />
            แต่ถ้ามา Talk n' Chip 2019<br />
            แล้วพูดไม่พอจะเสียใจ
          </Head>
          <Sub>23 กุมพาพันธ์ 2019 ณ มหาวิทยาลัยเทคโนโลยีพระจอมเกล้าธนบุรี อาคารเรียนรวม 2 ชั้น 4 ห้อง 2401 และ 2402</Sub>
        </div>
      </div>
      </div>
                    );
                  }
                }
export default App
